import React from 'react';
import './modal-backdrop.scss';

 const ModalBackdrop = (props)=>{

   let backdrop = props.hidden ?
     <div onClick = {props.click} className ="modal-backdrop">
       {props.children}
     </div>
     :
     null;


  return(
    {backdrop}
  )
}

export default ModalBackdrop;
